import Flower from './images/stockimag.jpg'

function Images() {
    return (
  
      <div className="App">
        <img src={Flower}
         style={{width: 500, height: 500, padding: 1, marginLeft: 1000}} />
      </div>
  
    );
  }
  
  export default Images;
